import React from 'react';

class Menubar extends React.Component {
  render() {
    return(
      <ul class="nav" id="menu">

      <li class="nav-item">
        <a class = "text-dark nav-link" aria-current="page" href="#">홈</a>
      </li>
      <li class="nav-item">
        <a class = "text-dark nav-link active" href="{{ url_for('main.generate_article_list', c1='총칙', c2=0) }}">카테고리별 민법</a>
      </li>
      <li class="nav-item">
        <a class = "text-dark nav-link" href="{{ url_for('main.generate_pan_list', c1='총칙', c2='*') }}">카테고리별 판례</a>
      </li>
      <li class="nav-item">
        <a class = "text-dark nav-link" href="{{ url_for('main.pan') }}?input=0">판례 추천</a>
      </li>
    </ul>
    )
  }
}

export default Menubar
